import React, { useState, useEffect } from "react";
import { useNavigate } from 'react-router-dom';
export default function Table(props) {
    const [titles, setTitles] = useState([])
    const [jobsDetails, setJobsDetails] = useState([])

    useEffect(() => {
        const defineTitleArray = async () => {
            setJobsDetails(await props.jobsDetails);
            let titlesArray = [];
            for (const key in props.jobsDetails[0]) {
                titlesArray.push(key);
            }
            setTitles(titlesArray);
        };
        defineTitleArray();
    }, [props.jobsDetails]);

    return (<div >
        <table border="1px">
            <thead>
                <tr>
                   

                    {
                        jobsDetails ? titles.map((title) =>
                        (
                            < th key={new Date()+title}>{title}</th>
                        )) :
                            < th ></th>

                    }

                </tr>
            </thead>
            {jobsDetails ? jobsDetails.map((jobDetail, i) =>
            (<tr key={new Date()+i}>
                {titles.map((title) => (
                    <td >"{String(jobDetail[title])}"</td>
                ))}
            </tr>
            )
            ) : <tr></tr>}



        </table>
    </div >);
}
